import { Card, Container } from 'react-bootstrap';
import MyStyle from '../styles/colorStyle';

const Footer = () => (
    <div>
        <Card style={MyStyle.col_background}>
            <p className="text-center">
                Copyright@ 2020
                    <span> Muhalik </span>
                - Online Shopping Website
            </p>
        </Card>
        <style jsx>{`
            div {
                position: absolute;
                left: 0;
                bottom: 0; 
                right: 0;
                padding-top: 10px
            }
            p {
                font-size: smaller;
            }
            span {
                font-size: medium;
                font-weight: bold;
            }
        `}</style>
    </div>
)

export default Footer;
